import React, { Component } from 'react'

export default class PaginationList extends Component {
  constructor(props){
    super(props)

  }
    render() {
      const {totalPage, currentPage} = 1
        return (
            <div className="tblfooter d-flex">
                    <div className="records d-flex align-items-center">
                      <div className="custom-selectbox">
                        <select className="form-control" name="options">
                          <option value="option-1">10</option>  
                          <option value="option-2">20</option>
                          <option value="option-3">30</option>
                        </select>
                      </div>
                      <label htmlFor>Records Per Page</label>
                    </div>
                    <div className="page">
                      <div className="form-group d-flex">
                        <label htmlFor="materialname">Page</label>
                        <input type="text" className="form-control" id="materialname" value={currentPage} />
                        <label htmlFor="materialname">of 1113{totalPage}</label>
                      </div>
                    </div>
                    <nav className="pagination" aria-label="Page navigation example">
                      <ul className="pagination">
                        <li className="page-item hide"><a className="page-link" onClick={() => alert('1')} href="#">First</a></li>
                        <li className="page-item hide"><a className="page-link" href="#">pre</a></li>
                        <RowList totalPage={totalPage} />
                        <li className="page-item"><a className="page-link" href="#">Next</a></li>
                        <li className="page-item"><a className="page-link" href="#">Last</a></li>
                      </ul>
                    </nav>
                  </div>
        )
    }
}

const RowList = () => {
  let rowToReturn = [];
  for (let i = 1; i <3; i++) { 
    rowToReturn.push(<li className="page-item"><a className="page-link" href="#">1</a></li>); 
  } 
    return rowToReturn;
}
